function a11yProps(index: any) {
  return {
    id: `vertical-tab-${index}`,
    'aria-controls': `vertical-tabpanel-${index}`,
  };
}

interface FormProps {
  label: string;
  name: keyof ConfigInterface;
  state: string | boolean;
  handler: (event: React.ChangeEvent<HTMLInputElement>) => void;
}

export type FormState = ConfigInterface;

function Check(props: FormProps) {
  const classes = useStyles();
  return (
    <FormControlLabel
      className={classes.checkbox}
      control={
        <Checkbox
          name={props.name}
          color="primary"
          checked={props.state as boolean}
          onChange={props.handler}
        />
      }
      label={props.label}
    />
  );
}

function Text(props: FormProps) {
  const classes = useStyles();
  return (
    <TextField
      className={classes.textField}
      label={props.label}
      value={props.state as string}
      name={props.name}
      onChange={props.handler}
      variant="outlined"
      color="primary"
    />
  );
}

interface ColorProps extends FormProps {
  colorHandler: (color: string, name: string) => void;
}

function Color(props: ColorProps) {
  const handleChange = debounce(
    (colorValue: ColorType) => {
      requestAnimationFrame(() => {
        props.colorHandler('#' + colorValue.hex, props.name);
      });
    },
    20,
    {isImmediate: true},
  );
  return (
    <>
      <Grid container spacing={1} alignItems="center">
        <Grid xs={1} item>
          <ColorPicker
            disableTextfield
            hideTextfield
            disableAlpha
            onChange={handleChange}
            value={props.state as string}
          />
        </Grid>
        <Grid xs={11} item>
          <Text
            name={props.name}
            state={props.state}
            handler={props.handler}
            label={props.label}
          />
        </Grid>
      </Grid>
    </>
  );
}

